const findTheDifference = (s = "", t = "") => {
  const firsLetter = new Set(
    ...s.split("").sort(function (a, b) {
      return a.localeCompare(b);
    })
  );
  const secondLetter = new Set(
    ...t.split("").sort(function (a, b) {
      return a.localeCompare(b);
    })
  );
  let builder = "";
  for (let index = 0; index < Math.max(s.length, t.length); index++) {
    if (firsLetter[index] != secondLetter[index]) {
      builder += s[index] ?? t[index];
    }
  }

  return builder;
};

console.log(
  findTheDifference(
    "",
    ""
  )
);
